@import url('https://fonts.googleapis.com/css2?family=Open+Sans:wght@400;600&display=swap');

//Variables
$mainColor: #06b2bb;

* {
  box-sizing: border-box;
  margin:0;
  padding:0;
  font-family: 'Open Sans', sans-serif;
}

body {
  background: $mainColor;
}

.container {
width: 100vw;
height: 100vh;
display:flex;
place-items:center;
text-align:center;

}

.content {
  background:white;
  margin: 0 auto;
  height: 60%;
  width: 75%;
  display: flex;
  border-radius: 5px;
  box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
  text-align:center;
  justify-content: flex-start;
  align-items: center;
  color: $mainColor;
  flex-direction: column;
  }

  .header {
    text-align:center;
    padding-top:10px;
    font-weight: 800;
    font-size: 1.5rem;
  }

  .header p {
    font-weight: 400;
    font-size: 1rem;
  }

  .converter {
    margin-top: 20px;
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-gap: 40px;
    width: 90%;
  }

  .converter-right, .converter-left {
    width: 100%;
  }

  label {
    display: block;
    font-weight: 400;
    padding: 10px;
    font-size: 1.5rem;

  }

  input {
    padding: 8px;
    width: 90%;
    border: 1px solid $mainColor;
    border-radius: 5px;
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
    font-size: 1.25rem;
  }

  #rgb-input-1, #rgb-input-2, #rgb-input-3 {
    width: 29%;
  }

  #hex-output, #rgb-output {
    height: 50px;
    width: 90%;
    background: #000000;
    padding: 10px;
    margin-left: 5%;
    margin-top: 10px;
    border-radius: 5px;
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
  }

  #hex-error, #rgb-error {
    color: red;
    font-size: 1rem;
  }

  input:focus {
    border: 1px solid gray;
    background: $mainColor;
    color: white;
  }

  button {
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
    border: none;
    margin-top: 20px;
    padding: 8px;
    background: $mainColor;
    border-radius: 5px;
    color:white;
  }

  #hex-notification, #rgb-notification {
    padding: 15px;
    text-transform: capitalize;
  }

  footer {
    padding: 5px;
  }

  footer a {
    color:$mainColor;
  }

@media only screen and (max-width: 600px) {

  .container {
    width: 100vw;
    height: 100vh;
    display:flex;
    place-items:center;
    text-align:center;
    margin-top: 40px;

    }

    .content {
      height: auto;
      margin-top: 30px;
      min-height: 95%;
      width: 95%;

      }

      .header {
        text-align:center;
        padding-top:10px;
        font-weight: 800;
        font-size: 1.5rem;
      }

     .converter-right {
        margin-top: -40px;
      }

  .converter {
    grid-template-columns: 1fr;
  }
}
